import React from "react";

export default function Projects() {
  return (
    <section>
      <h2 style={{ fontSize: "1.75rem", fontWeight: 700 }}>Projects</h2>
      <p style={{ marginTop: 8 }}>Some of my works will be displayed here.</p>
    </section>
  );
}
